package module1;

public class UnaryOperatorDemo {

	public static void main(String[] args) {
		
		// TODO Auto-generated method stub
		/* Author:Gayathri B Nair
		 * Date:13/07/2025
		 */
		
		int counter=+1;
		System.out.println(counter);
		counter--;
		System.out.println(counter);
		counter++;
		System.out.println(counter);
		counter=-counter;
		System.out.println(counter);

	}

}
